import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    mainHeader: {
      textAlign: "center",
      fontWeight: "bold",
      fontSize: 30,
      marginTop: Platform.OS === 'ios' || Platform.OS === 'android' ? '10%' : '25%',
    },
  });
export default styles
